import React from 'react';
import style from './starry.jpg';
import contents from './mountains.jpeg';
import output from './output.png';

const img = {
  width: '450px', 
  height: '450px' 
}

const caption = {
  width: '450px'
}

const NSTExample = () => {
  return (
    <div className='dib flex-wrap'>
      <div className='ma4 center dib flex-wrap'>
        <img className='ma4 center dib' style={ img } src={contents} alt='' />
        <figcaption className='ba' style={caption}>Take your favourite picture</figcaption>
      </div>
      <div className='ma4 center dib flex'>
        <img className='ma4 center dib' style={ img } src={style} alt='' />
        <figcaption className='ba' style={caption}>Then grab a picture that reflects your favourite artists style</figcaption>
      </div>
      <div className='ma4 center dib flex'>
        <img className='ma4 center dib' style={ img } src={output} alt='' />
        <figcaption className='ba' style={caption}>We will run your images through a Neural Style Transfer deep learning model. Which will produce a result like this.</figcaption>
      </div>
    </div>
  );
}

export default NSTExample
